description:
Here it is, the long-awaited second part! 

In this game you will plunge into the world fully Simpsons ride a skateboard through the streets of Springfield, meet characters from The Simpsons.

Bart will help to complete all missions, but beware of fire hydrants, birds, parking machines and, of course, the Mafia. Enjoy the pleasant atmosphere of the game.

